let index = 1;
let song = new Audio('2.mp3');
let masterplay = document.querySelector('#masterplay');
let progressbar = document.querySelector('#range');

masterplay.addEventListener('click', () => {
    if (song.paused || song.currentTime <= 0) {
        song.play();
        masterplay.classList.remove('fa-play');
        masterplay.classList.add('fa-pause');
        let img1 = document.getElementById('image');
        img1.style.opacity = '1';
       
    } else {
        song.pause();
        let img1 = document.getElementById('image');
        img1.style.opacity = '0';
        masterplay.classList.remove('fa-pause');
        masterplay.classList.add('fa-play');
       
    }
});

song.addEventListener('timeupdate', () => {
    let progress = (song.currentTime / song.duration) * 100;
    progressbar.value = progress;
    let tame=document.querySelector("#tame");
   let min=0;
   let sec=0;
   let hacked=0;
   let zero='0';
   let minzero=0;
   if(song.currentTime<60)
   {
    sec=Math.round(song.currentTime);
    if(sec>9)
    {
        zero='';
    }
   }
else{
    min=Math.floor(song.currentTime/60);
    sec=Math.round(song.currentTime%60);
   if(min>9)
   {
    minzero='';
   }
   if(sec>9)
    {
        zero='';
    }
}

    tame.innerText=` ${minzero} ${min} : ${zero} ${sec} `;
});

progressbar.addEventListener('input', () => {
    song.currentTime = (progressbar.value * song.duration) / 100;
});

