// Corrected event listener for .playsong elements
const makeallplays = () => {
   let check= document.querySelectorAll(".playsong");
    check.forEach((element,i)=> {

       check[i].addEventListener('click',()=>{
        
        function colour() {
            songitems.forEach((ele, i) => {
                if (i !== (index - 1)) {
                    ele.style.backgroundColor = ""; // Reset to default
                }
            });
        }
        


      
        if(song.paused || song<=0)
        {
            song.play();
          
            element.classList.remove('fa-play');
            element.classList.add('fa-circle'); 
            songitems[index-1].style.backgroundColor = "green";
            masterplay.classList.remove('fa-play');
            masterplay.classList.add('fa-pause');
            
         colour();
         document.querySelector("#image").style.opacity='1';
         
        }
        else{
           
            song.pause();
           
            element.classList.remove('fa-circle'); 
            element.classList.add('fa-play');
            masterplay.classList.remove('fa-pause');
            masterplay.classList.add('fa-play');
            songitems[index - 1].style.backgroundColor = "";
            
            colour();
            document.querySelector("#image").style.opacity='0';
           
        }
       })
       element.classList.add('fa-play')
      
    })
    
}




function call()
{
    Array.from(document.querySelectorAll(".playsong")).forEach((element) => {
        element.addEventListener('click', (e) => {
            index=parseInt(e.target.id);
            console.log(e.target);
           
        song.src=`${index}.mp3`;
        song.currentTime=0;
        // song.play();
        masterplay.classList.remove('fa-play');
        masterplay.classList.add('fa-pause');

        makeallplays();
       
        })
    })
}
